# DROP DATABASE IF EXISTS lucasluz_test_assignment;
CREATE DATABASE IF NOT EXISTS lucasluz_test_assignment;
USE lucasluz_test_assignment;

CREATE TABLE IF NOT EXISTS subscriptions(
	id VARCHAR(36) PRIMARY KEY, # UUID generated and managed by our backend
    first_name VARCHAR(20) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    email varchar(100) NOT NULL UNIQUE,
    `status` TINYINT DEFAULT 2,
    created_at datetime default now(),
    updated_at datetime default now(),
    searchable  VARCHAR(170)
);

# trigger to populate our searchable field after each new insert
CREATE TRIGGER before_insert_test
BEFORE INSERT ON subscriptions
FOR EACH ROW
SET NEW.searchable = CONCAT(NEW.first_name, NEW.last_name, NEW.email);

# trigger to update our searchable field after each user update
CREATE TRIGGER before_update_test
BEFORE UPDATE ON subscriptions
FOR EACH ROW
SET NEW.searchable = CONCAT(NEW.first_name, NEW.last_name, NEW.email);

